function Item(props){
    const {item}=props
    return(
        <tr className="border-b-2 flex ">
            <td className="p-2 flex items-center">{item.image && <img src={item.image} className="w-10 h-10 mr-5"/>}<>{item.name}</></td>
            <td className="p-2">{item.symbol}</td>
            <td className="p-2">{'$ '+(item.current_price).toLocaleString('en-US')}</td>
            <td className={`p-2 flex items-center ${item.price_change_percentage_24h<0 ?'text-red-400':'text-green-400'}`}><img src={`${item.price_change_percentage_24h<0?'/downarrow.png':'/uparrow.png'}`} className="w-2 h-2"/><>{Number(item.price_change_percentage_24h).toFixed(2).toString()+" %"}</></td>
        </tr>
    )
}
export default Item
